import React,{useState}from 'react';
import './nav.css'
import logo from './logo.png'

function Nav() {
  const[showLinks,setShowLinks]= useState(false);
   
    return (
        
        <div className='navContainer'>
            <a href='/home'><img src={logo} className='navLogo'alt='logo'></img></a> 
        <div className="links" id={showLinks ? "hidden" : ""}>
            <a href='/service' className='navService'>Service</a>
             <a href='/aboutus' className='navAboutus'>AboutUs</a>
             <a href='/ourwork' className='navOurwork'>Our Work</a>
             <a href='/contact' className='navContact'>Contact</a>
             </div>
          <button onClick={()=>setShowLinks(!showLinks)} className='navMenu'>menu</button>
            </div>
            );
}

export default Nav;
